import React, { useEffect } from 'react';
import { useAuth } from '../context/authcontext';
import './card.scss';

const Card = () => {
  const { DisplayPlan, plans } = useAuth();

  useEffect(() => {
    DisplayPlan();
  }, []);
  return (
    <div className="container">
      <div className="title1 title1--mod">
        <h2>Shop Plans</h2>
      </div>
      <div className="flex">
      {plans.map((plan) => {
            <div key={plan._id} className="card">
            <div className="shop-plan">
              <h3>{plan.plan_type}</h3>
            </div>
            <div className="card-items">
              <div className="card-content">
                <div>
                  <h3>Number of member: {plan.number_of_members}</h3>
                  <h3>Total package: ${plan.planPrice}</h3>
                </div>

                <div className="main-content">
                  <h3>Benefits</h3>
                  <p>
                    Many commonly prescribed drugs are as <br /> little as $3.1
                    Get a prescription.
                  </p>
                </div>
              </div>

              <div className="card-content">
                <button className="card-btn">Subscribe</button>
              </div>
            </div>
          </div>
          })}

      </div>
    </div>
  );
};

export default Card;
